import React, {Component} from 'react';
import { Modal } from 'reactstrap';


class ModalTest extends React {
    render() {
    
    return (
            <Modal isOpen={this.modal} toggle={this.toggle}>

            </Modal>
        )
    }
}
export default ModalTest
